Como fazer a medição do oxigênio no sangue: 
1. Use o relógio com a largura de um dedo abaixo do osso do pulso e use-o em uma posição confortável no pulso; 
2. Depois de entrar no modo de detecção de oxigênio no sangue, fique quieto, certifique-se de que seu pulso esteja reto e que o relógio esteja voltado para cima. Se você estiver sentado, coloque os braços sobre a mesa com o relógio voltado para cima; 
3. Por favor, mantenha o braço firme até obter o resultado final.
